import React from "react"
import "./navbarstyles.css"
import {Link } from "react-router-dom"
const navbar = () => {
  return (
    <div>
        <Link to="/">
        <h1>Portfolio.</h1>
        </Link>
    </div>
  )
}

export default navbar
